import styled from "styled-components";

export const SignupWrapper = styled.div`

.topContainer {
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    margin-top: 50px;
}

.signupContainer{
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    margin: 40px;
    height: 400px;
    width: 600px;
}

.header{
    display: flex;
    justify-content: center;
    margin: 30px;
}

.MuiInputBase-input {
    width 500px;
}

.MuiButtonBase-root{
    width: 400px;
    margin: 30px;
}
`;
